import React from 'react';
import { withRouter } from 'react-router-dom';

var PostComplete =(props)=>{
    var openPost = props.openPost(props.match.params.postIndex);

    return openPost ? (
        <div>
            <h2>{openPost.title}</h2>
            <p>{openPost.Topic}</p>
            <p>{openPost.author}</p>
        </div>
    ) : null;
}

export default withRouter(PostComplete);
